import React from 'react';
import classes from './SecondPost.module.css'
import {NavLink} from "react-router-dom";
import MessageSend from "./Message/MessageSend";
import DialigItem from "./Dialogitem/DialigItem";
import app from "../../App";




/* let dialogsData = [
     {id: 1, name: 'Dima'},
     {id: 2, name: 'Andre'},
     {id: 3, name: 'Sasha'},
 ]*/


 let messagesData = [
     {id: 1, message: 'hi'},
     {id: 2, message: 'hi'},
     {id: 3, message: 'hi'},
     {id: 4, message: 'hi'},
 ]
let messagesElements = messagesData
    .map(message => <MessageSend message={messagesData.message} />);

let dialogsElements = this.props.dialogsData
    .map( dialog => <DialigItem name={dialog.name} id={dialog.id}/>);

const SecondPost = (props) => {


    return (
        <div className={classes.dialogs}>
            <div className={classes.dialogsItem}>

                <DialigItem name={props.dialogsData[0].name} id={props.dialogsData[0].id}/>
                <DialigItem name={props.dialogsData[1].name} id={props.dialogsData[1].id}/>
                <DialigItem name={props.dialogsData[2].name} id={props.dialogsData[2].id}/>
            </div>
            <div className={classes.messages}>
                <MessageSend message={messagesData[0].message} />
                <MessageSend message={messagesData[1].message}/>
                <MessageSend message='ho'/>

            </div>
        </div>
    );
};

export default SecondPost;
